The Football League Show 09.02.2014

Duration: 1 hour 20 min

Manish Bhasin presents all the drama from the Football League. Leicester have been the team to beat since the New Year. This week the Foxes meet a Watford side readjusting to life under new manager Beppe Sannino. Plus, battling to retain their Championship status, Yeovil entertain Leeds United.
